import React from 'react';
import { Link } from 'react-router-dom';

const DoctorDashboard = () => {
  return (
    <div>
      <h2>Doctor Dashboard</h2>
      <ul>
        <li><Link to="/pages/ViewAllAppointments">View All Appointments</Link></li>
      </ul>
    </div>
  );
};

export default DoctorDashboard;
